post_content = "Australia is a country in the Southern hemisphere between the Pacific Ocean and the Indian Ocean. Its official name is the Commonwealth of Australia. Australia is the sixth biggest country in the world by landmass, and is part of the Oceanic and Australasian regions. The Australian emblem is a flower called the Golden Wattle.

23â€“24 million people live in Australia, and about 80% of them live on the east coast. About 60% live in and around the mainland state capitals of Sydney, Melbourne, Brisbane, Perth and Adelaide. Australia's capital city is Canberra.

Australia is known for its mining and for its production of wool. Australia is the world's largest producer of bauxite.[9]

Australia, New Zealand, New Guinea and other islands on the Australian tectonic plate are together called Australasia. They form one of the world's great ecozones. When other Pacific islands are included, the term is Oceania.
http://simple.wikipedia.org/wiki/Australia"
